import React from "react";
import TableMUI from "./components/TableMUI";
import Header from "./components/Header";
import { BrowserRouter } from "react-router-dom";


function App() {

  return (
    // In order to use the React Router DOM we wrap the whole thing inside the BrowserRouter component, which we get from "react-router-dom" module. 
    <BrowserRouter className="App">

      <Header />

      <TableMUI />

    </BrowserRouter>
  );
}

export default App;
